  sets that describe aquifer characteristics of the alluvial and terrace deposits
  along the Beaver-North Canadian River from the panhandle to Canton Lake in northwestern
  Oklahoma\",\n\t\"tracking_summary\": {\n\t\t\"total\": 6,\n\t\t\"recent\": 1\n\t},\n\t\"groups\":
