  \"access_constraints\",\n\t\t\"value\": \"[\"Use Constraints: Features representing
  aquifer boundaries along geological contacts were extracted from a digital geology
  data set by Cederstrand (1996) based on a scale of 1:250,000. Boundaries defining
  the geographic limits of the aquifer and areas of little or no saturated thickness
  were digitized from a folded paper map (30 inches by 22 inches), at a scale of 1:250,000
  (Davis and Christenson, 1981, plate 3). The digitized aquifer boundaries had a maximum
  registration root-mean-squared-error (RMSE) of 0.017 map inches (0.043 map centimeters)
  or 354.0 feet (107.90 meters) ground distance. Boundaries represented at this scale
  are indicative of broad, regional trends and should not be interpreted as site specific.\",
